export default function AddTask({inputText, todoCategory,onAddTask,  onSetInput, onSetTodoCategory}) {
  return (
   <form>
    <input type="text" value={inputText} onChange={(e) => onSetInput(e.target.value)} placeholder="Add new task..." />
    <select value={todoCategory} onChange={(e) => onSetTodoCategory(e.target.value)}>   
    <option>To DO</option>

    </select>
    <button type="submit">Add Task</button>
   </form>
  );
}
